import React from 'react';
import { Route, Switch, Redirect} from 'react-router-dom';
import domelec from '../../domelec+.jpg';
import './index.css';

import Home from '../Home';
import Actualities from '../Actualities';
import Automatism from '../Automatism';
import Automotion from '../Automotion';
import Contact from '../../containers/Contact';
import Electricity from '../Electricity';
import Jobs from '../Jobs';
import Nav from '../Nav';
import NotFound  from '../NotFound';
import Partners from '../Partners';
import Presentation from '../Presentation';
import References from '../References';
import Telemanagement from '../Telemanagement';
import Training from '../Training';


const App = () => {
  return (
    <div className="App">
      <header className="App-header">
        <img src={domelec} className="App-logo" alt="logo" />
         <Nav />
      </header>
      <Switch>
        <Route path="/" exact component={Home}/>
        <Route path="/404" exact component={NotFound}/>
        <Route path="/actualite" exact component={Actualities}/>
        <Route path="/automatisme-informatique-industrielle" exact component={Automatism}/>
        <Route path="/domotique-securisation" exact component={Automotion}/>
        <Route path="/contact" exact component={Contact}/>
        <Route path="/electricite" exact component={Electricity}/>
        <Route path="/jobs" exact component={Jobs}/>
        <Route path="/partenaires" exact component={Partners}/>
        <Route path="/presentation" exact component={Presentation}/>
        <Route path="/references" exact component={References}/>
        <Route path="/telegestion" exact component={Telemanagement}/>
        <Route path="/formation" exact component={Training}/>
          <Redirect to="/404" />
      </Switch>
    </div>
  );
}

export default App;
